import React from 'react'
import { useNavigate, useParams } from 'react-router-dom'
function Host ({Host}) {
  let {id}=useParams()
    let navigate=useNavigate();
  return (
    <div style={{textAlign:'center'}}>
    <button className='btn btn-success' style={{}} onClick={()=>navigate('/Activity')}>Back</button>
{Activity.filter((Activity)=>Activity.id==id).map((Activity)=>
<div >
     <h1>{Activity.title}</h1>
       <p>{Host}</p>
       <p>hourly: {Activity.hourly}</p> 
      <iframe width="967" height="544" src={Activity.trailer} 
title="YouTube video player" frameborder="0"
allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
allowfullscreen></iframe>
</div>
)}
</div>
)
}


export default Host
